import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import HomePage from "./homepage/HomePage";
import ForgotPassword from "./login/ForgotPassword";
import Signup from "./login/Signup"; // when signup.js is done
import ResetPassword from "./login/ResetPassword"; // Import ResetPassword page

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="/forgot-password" element={<ForgotPassword />} />
        <Route path="/signup" element={<Signup />} /> {/* when signup.js is done */}
        <Route path="/reset-password/:token" element={<ResetPassword />} /> {/* Add ResetPassword route */}
      </Routes>
    </Router>
  );
}

export default App;
